import React, { Component } from 'react';
import './App.css';
import Testdad from './components/Testdad';


class App extends Component {
  render() {
    return (
      <div className="App">
        <Testdad title ="tom" />
        <Testdad title ="jerry" />
        <Testdad title = "doggy" />
        <Testdad title ="skull"/>
      </div>
    );
  }
}

export default App;
